import { Fragment } from "react";
import classes from './Header.css';
import meals from '../../Assets/meals.jpg';
const Header=(props)=>{
    return <Fragment>
        <header className={classes.header}>
            <h1>React Meals</h1>
            <button>Cart</button>
        </header>
        <div className={classes["main-image"]}>
            <img src={meals}/>
        </div>
    </Fragment>
}

export default Header;
